INSERT INTO `tips` VALUES (20,'Rahasia Nasi Goreng Jadi Enak','<p>\"Baceman Bawang\" merupakan rahasia nasi goreng yang menjadi ciri khas makanan kediri.</p>','<ol>\n<li>Bahan : bawang putih 100 gram (20-25 siung) , kemiri 1 biji . Kupas dan cuci bawang putih, tiriskan sampai kering. Kalau perlu dibalut pake tissue sekalian dan biarkan seharian sampe benar-benar kering. Jangan ada air satu tetespun.</li>\n<li>Haluskan kemiri, Tumbuk kasar bawang putih.</li>\n<li>Masukkan ke dalam toples kaca</li>\n<li>Tambahkan minyak goreng sampai menutup seluruh bawang putih</li>\n</ol>\n<p>Tutup rapat kedap udara. Biarkan sampai berfermentasi.<br /> <br /> Tunggu sampai minimal 24 jam dan siap untuk digunakan bisa untuk nasi goreng, bakmi jawa, sambal goreng dan berbagai macam tumisan lain.</p>\n<ul>\n<li>Bisa disimpan sampai sebulan, asal rapat kedap udara. makin lama berfermentasi makin enak, walaupun begitu ada baiknya bikin baceman bawang yang gak terlalu banyak kira2 1-2 minggu habis, agar dapet baceman bawang yg selalu fresh.</li>\n<li>Dalam seminggu sebaiknya tetap di suhu ruang, selebihnya baru bisa masuk kulkas.</li>\n<li>Sebaiknya beri sendok khusus didalamnya agar tdk terkontaminasi tetesan air dan bahan lainnya jika pakai sendok yang lain.</li>\n</ul>\n<p><strong>Cara pakai:</strong> ambil bawang + minyak secukupnya dengan sendok lalu tumis bersama bumbu tambahan lain sesuai jenis masakan dan selera anda. Baceman bawang hanya sebagai pengganti bawang putih saja agar rasa dan aromanya lebih sedap. Jika minyak dalam toples sudah menyusut atau hampir habis bisa tambahkan minyak lagi .</p>',5),(21,'Tips Dapatkan Diskon alat masak','<p>Selalu menunggu untuk dapat diskon alat masakan? Atau malah sering beli alat masakan tapi ternyata kemahalan?ikuti tips ini untuk mendapatkan penawaran terbaik.</p>','',5),(22,'Edit Foto Makanan','<p>Penasaran bagaimana mengedit foto supaya kelihatan lebih enak dan menarik? Mungkin kalian hanya memiliki kamera hp dengan resolusi standar. namun dengan editor photo kakian bisa tetap membuatnya lebih menarik lo.. simak tips nya.</p>','<p>Saat mengedit foto makanan yang harus di ubah adalah kontras, saturation, dan temperature.</p>\n<p>ketiga hal itu wajib agak ditinggikan (setting). Apalagi jika yang di foto adalah daging.. Kelihatan Yummy sekali..</p>\n<p>&nbsp;</p>\n<p>Try it!!</p>',5),(23,'LOL','<p>LOL</p>','<p>HA-HA-HA-HA-HA-HA</p>',7);
